const convertProfileData = (data) => {
    const convertedProfiles = data.profiles.map(profile => ({
        ...profile,
        id: profile.id.toString(),
        answers: profile.answers.map(answer => ({
            qId: answer.qId.toString(),
            answer: answer.answer.toString(),
            acceptableAnswers: answer.acceptableAnswers.map(a => a.toString()),
            importance: answer.importance.toString()
        }))
    }));

    return { profiles: convertedProfiles };
};

